bp("immutable/dequeue.effekt","module immutable/dequeue\n\nimport immutable/list\nimport immutable/option\n\n// An implementation of a functional dequeue, using Okasaki's\n// bankers dequeue implementation.\n//\n// Translation from the Haskell implementation:\n//   https://hackage.haskell.org/package/dequeue-0.1.12/docs/src/Data-Dequeue.html#Dequeue\nrecord Dequeue[R](front: List[R], frontSize: Int, rear: List[R], rearSize: Int)\n\ndef emptyQueue[R](): Dequeue[R] \x3d Dequeue(Nil(), 0, Nil(), 0)\n\ndef isEmpty[R](dq: Dequeue[R]): Boolean \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e (fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 0)\n}\n\ndef size[R](dq: Dequeue[R]): Int \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e fs + rs\n}\n\ndef first[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 1)) { r.headOption }\n      else { f.headOption }\n}\n\ndef last[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 1) \x26\x26 (rs \x3d\x3d 0)) { f.headOption }\n      else { r.headOption }\n}\n\ndef check[R](dq: Dequeue[R]): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n        val c \x3d 4;\n        val size1 \x3d (fs + rs) / 2;\n        val size2 \x3d (fs + rs) - size1;\n\n        if (fs \x3e c * rs + 1) {\n            val front \x3d f.take(size1);\n            val rear \x3d r.append(f.drop(size1).reverse);\n            Dequeue(front, size1, rear, size2)\n        } else if (rs \x3e c * fs + 1) {\n            val front \x3d f.append(r.drop(size1).reverse);\n            val rear \x3d r.take(size1);\n            Dequeue(front, size2, rear, size1)\n        } else {\n            dq\n        }\n}\n\ndef pushFront[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(Cons(el, f), fs + 1, r, rs).check\n}\n\ndef popFront[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Nil(), fs, Cons(x, Nil()), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(Nil(), fs, r, rs) \x3d\x3e\n        None()\n    case Dequeue(Cons(x, rest), fs, r, rs) \x3d\x3e\n        Some((x, Dequeue(rest, fs - 1, r, rs).check))\n}\n\ndef pushBack[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(f, fs, Cons(el, r), rs + 1).check\n}\n\ndef popBack[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Cons(x, Nil()), fs, Nil(), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(f, fs, Nil(), rs) \x3d\x3e\n        None()\n    case Dequeue(f, fs, Cons(x, rest), rs) \x3d\x3e\n        Some((x, Dequeue(f, fs, rest, rs - 1).check))\n}\n");
bp("effekt_matching.js",'// matchers: Any -\x3e List[Any] | null\nconst $matching \x3d (function() {\n\n    const any \x3d x \x3d\x3e [x]\n\n    const ignore \x3d x \x3d\x3e []\n\n    const bind \x3d matcher \x3d\x3e x \x3d\x3e {\n        const matched \x3d matcher(x)\n        if (matched \x3d\x3d null) return null;\n        return [x].concat(matched)\n    }\n\n    const literal \x3d c \x3d\x3e x \x3d\x3e {\n        if (equals$impl(c, x))\n            return []\n        else\n            return null\n    }\n\n    function tagged(tag) {\n        const matchers \x3d arguments\n        return x \x3d\x3e {\n            if (!x || !x.__tag || x.__tag !\x3d\x3d tag) return null;\n            var extracted \x3d [];\n            // we start at 1 since matchers are shifted by 1\n            for (var i \x3d 1; i \x3c matchers.length; i++) {\n                const matched \x3d matchers[i](x.__data[i - 1]);\n                if (matched \x3d\x3d\x3d null) return null;\n                Array.prototype.push.apply(extracted, matched)\n            }\n            return extracted;\n        }\n    }\n\n    function match(x, alternatives) {\n        for (var i in alternatives) {\n            const alt \x3d alternatives[i]\n            const matched \x3d alt.pattern(x)\n            if (matched !\x3d\x3d null) {\n                return alt.exec.apply(null, matched)\n            }\n        }\n    }\n\n    return {\n        any: any,\n        ignore: ignore,\n        tagged: tagged,\n        bind: bind,\n        literal: literal,\n        match: match\n    }\n})();\n\nObject.assign($effekt, $matching);\n\n\n// p0 \x3d bind(tagged("Nil"))\n// p1 \x3d bind(tagged("Cons", any, any))\n// p2 \x3d tagged("Cons", any, bind(tagged("Cons", any, ignore)))\n\n// l0 \x3d { tag: "Nil", data: [] }\n// l1 \x3d { tag: "Cons", data: [1, l0] }\n// l2 \x3d { tag: "Cons", data: [1, { tag: "Cons", data: [2, { tag: "Nil", data: [] }] }] }\n\n// console.log(p1(l0))\n// console.log(p1(l1))\n// console.log(p1(l2))\n\n// console.log(p2(l0))\n// console.log(p2(l1))\n// console.log(p2(l2))\n\n// match(l2, [\n//     { pattern: p0, exec: () \x3d\x3e console.log("It is Nil!") },\n//     { pattern: p2, exec: (x, y) \x3d\x3e console.log("It has at least two elements", x, y) },\n//     { pattern: p1, exec: (x, rest) \x3d\x3e console.log("It only has one element", x) }\n// ])\n');
bp("web/dom.effekt",'module web/dom\n\nextern type Node\n\n// can be null\nextern pure def getElementById(id: String): Node \x3d\n  "document.getElementById(${id})"\n\nextern pure def createElement(tag: String): Node \x3d\n  "document.createElement(${tag})"\n\nextern pure def createTextNode(text: String): Node \x3d\n  "document.createTextNode(${text})"\n\nextern pure def setAttribute(node: Node, key: String, value: String): Node \x3d\n  "${node}.setAttribute(${key}, ${value})"\n\n// the string return type is wrong here...\nextern pure def getAttribute(node: Node, key: String): String \x3d\n  "${node}.getAttribute(${key})"\n\nextern pure def appendChild(node: Node, child: Node): Node \x3d\n  "${node}.appendChild(${child})"\n\nextern pure def innerHTML(node: Node, contents: String): Node \x3d\n  "(function() { ${node}.innerHTML \x3d ${contents}; return ${node} })()"\n\nextern type IdleDeadline\n\nextern pure def requestIdleCallback(callback: (IdleDeadline) \x3d\x3e Unit at {io}): Unit \x3d\n  "window.requestIdleCallback(deadline \x3d\x3e ${callback}(deadline).run())"\n\nextern pure def didDimeout(deadline: IdleDeadline): Boolean \x3d\n  "${deadline}.didTimeout"\n\nextern pure def timeRemaining(deadline: IdleDeadline): Double \x3d\n  "${deadline}.timeRemaining()"\n\nextern pure def onClick(node: Node, handler: () \x3d\x3e Unit at {io}): Node \x3d\n  "(function() { ${node}.onclick \x3d () \x3d\x3e ${handler}().run(); return ${node} })()"\n\nextern def sleep(n: Int): Unit \x3d\n  "$effekt.callcc(k \x3d\x3e window.setTimeout(() \x3d\x3e k(null), ${n}))"\n\ndef clear(node: Node) \x3d node.innerHTML("")\n');
bp("text/regex.effekt",'module text/regex\n\nimport text/string\nimport immutable/option\n\nextern type Regex\n\nrecord Match(matched: String, index: Int)\n\nextern pure def regex(str: String): Regex \x3d\n  "new RegExp(${str})"\n\ndef exec(reg: Regex, str: String): Option[Match] \x3d\n  reg.unsafeExec(str).undefinedToOption match {\n    case None() \x3d\x3e None()\n    case Some(v) \x3d\x3e Some(Match(v.matched, v.index))\n  }\n\n// internal representation { matched: String, index: Int }\nextern type RegexMatch\nextern pure def matched(r: RegexMatch): String \x3d "${r}.matched"\nextern pure def index(r: RegexMatch): Int \x3d "${r}.index"\n\nextern !!!MULTILINEMARKER!!!\nfunction regex$exec(reg, str) {\n  var res \x3d reg.exec(str);\n  if (res \x3d\x3d\x3d null) { return undefined }\n  else { return { matched: res[0], index: res.index } }\n}\n!!!MULTILINEMARKER!!!\n\n// internals\nextern io def unsafeExec(reg: Regex, str: String): RegexMatch \x3d\n  "regex$exec(${reg}, ${str})"\n');
bp("text/string.effekt",'module text/string\n\nimport immutable/option\nimport mutable/array\n\ndef charAt(str: String, index: Int): Option[String] \x3d\n    str.unsafeCharAt(index).undefinedToOption\n\nextern pure def length(str: String): Int \x3d\n  "${str}.length"\n\nextern pure def repeat(str: String, n: Int): String \x3d\n  "${str}.repeat(${n})"\n\nextern pure def unsafeSubstring(str: String, from: Int, to: Int): String \x3d\n  "${str}.substring(${from}, ${to})"\n\ndef substring(str: String, from: Int, to: Int): String \x3d\n  if (from \x3e\x3d to) { "" }\n  else {\n    str.unsafeSubstring(from, to)\n  }\n\ndef substring(str: String, from: Int): String \x3d\n  str.unsafeSubstring(from, str.length)\n\nextern pure def split(str: String, sep: String): Array[String] \x3d\n  "${str}.split(${sep})"\n\nextern pure def trim(str: String): String \x3d\n  "${str}.trim()"\n\ndef toInt(str: String): Option[Int] \x3d\n  str.unsafeToInt.undefinedToOption\n\nextern pure def unsafeCharAt(str: String, n: Int): String \x3d\n  "${str}[${n}]"\n\nextern pure def unsafeToInt(str: String): Int \x3d\n  "(Number.isNaN(parseInt(${str})) ? undefined : parseInt(${str}))"\n\ndef indexOf(str: String, sub: String): Option[Int] \x3d {\n  val index \x3d str.unsafeIndexOf(sub)\n  if (index \x3c 0) { None() } else { Some(index) }\n}\n\ndef lastIndexOf(str: String, sub: String): Option[Int] \x3d {\n  val index \x3d str.unsafeLastIndexOf(sub)\n  if (index \x3c 0) { None() } else { Some(index) }\n}\n\nextern pure def unsafeIndexOf(str: String, sub: String): Int \x3d "${str}.indexOf(${sub})"\nextern pure def unsafeLastIndexOf(str: String, sub: String): Int \x3d "${str}.lastIndexOf(${sub})"\n\nextern pure def startsWith(str: String, prefix: String): Boolean \x3d\n  "${str}.startsWith(${prefix})"\n\nextern pure def endsWith(str: String, suffix: String): Boolean \x3d\n  "${str}.endsWith(${suffix})"\n\n// ANSI escape codes\nval ANSI_GREEN \x3d "\\u001b[32m"\nval ANSI_RED \x3d "\\u001b[31m"\nval ANSI_RESET \x3d "\\u001b[0m"\n');
bp("unsafe/cont.effekt",'module unsafe/cont\n\n// The type of a captured continuation\nextern type Cont[A, B]\n\n// we mark this as {io} since pure functions should not take block parameters.\nextern io def cont[A, B] { r: A \x3d\x3e B / {} }: Cont[A, B] \x3d "${box r}"\n\n// This is unsafe if the continuation left the scope of the\n// capabilities it closed over\nextern control def apply[A, B](k: Cont[A, B], a: A): B / {} \x3d "${k}(${a})"\n');bp("test.effekt",'import text/string\n\ninterface Assertion {\n  def assert(condition: Boolean, msg: String): Unit\n}\n\ndef assertTrue(condition: Boolean, msg: String) \x3d\n  do assert(condition, msg)\n\ndef assertTrue(condition: Boolean) \x3d\n  do assert(condition, "Assertion failed")\n\ndef assertFalse(condition: Boolean, msg: String) \x3d\n  do assert(not(condition), msg)\n\ndef assertFalse(condition: Boolean) \x3d\n  do assert(not(condition), "Assertion failed")\n\ndef assertEqual[A](obtained: A, expected: A, msg: String) \x3d\n  do assert(obtained \x3d\x3d expected, msg)\n\ndef assertEqual[A](obtained: A, expected: A) \x3d\n  do assert(obtained \x3d\x3d expected, "Obtained: " ++ obtained.show ++ "\\n but expected:" ++ expected.show)\n\ninterface Test {\n  def success(name: String): Unit\n  def failure(name: String, msg: String): Unit\n}\n\ndef test(name: String) { body: \x3d\x3e Unit / Assertion } \x3d\n  try { body(); do success(name) } with Assertion {\n    def assert(condition, msg) \x3d if (condition) resume(()) else do failure(name, msg)\n  }\n\ndef suite(name: String) { body: \x3d\x3e Unit / Test }: Boolean \x3d {\n  println("Running suite: " ++ name);\n  var failed \x3d 0\n  var passed \x3d 0\n\n  try { body() } with Test {\n    def success(name) \x3d {\n      passed \x3d passed + 1\n      println(ANSI_GREEN ++ "+ " ++ name ++ "" ++ ANSI_RESET);\n      resume(())\n    }\n    def failure(name, msg) \x3d {\n      failed \x3d failed + 1\n      println(ANSI_RED ++ "- (FAIL) " ++ name ++ "\\n    " ++ msg ++ ANSI_RESET);\n      resume(())\n    }\n  }\n  if (failed \x3e 0) {\n    println(ANSI_RED ++ "Some tests failed (" ++ passed.show ++ " passed, " ++ failed.show ++ " failed)" ++ ANSI_RESET)\n    false\n  } else {\n    println(ANSI_GREEN ++ "All tests passed (" ++ passed.show ++ " passed)" ++ ANSI_RESET)\n    true\n  }\n}');
